private static boolean endsWith(final String str,final String suffix,final boolean ignoreCase){
    if(str == null || suffix == null) return false;
    if(suffix.length() > str.length()) return false;
    int strOffset = str.length() - suffix.length();
    int suffixOffset = 0;
    while(suffixOffset < suffix.length()){
        char strChar = str.charAt(strOffset + suffixOffset);
        char suffixChar = suffix.charAt(suffixOffset);
        if(ignoreCase){
            if(Character.toUpperCase(strChar) != Character.toUpperCase(suffixChar)) return false;
        }else{
            if(strChar != suffixChar) return false;
        }
        suffixOffset++;
    }
    return true;
}

