public String format(final LoggingEvent event){
    // Check if the layout is active
    if (!isActive()) {
        return "";
    }

    // Initialize buffer to hold formatted output
    StringBuffer sbuf = new StringBuffer(BUF_SIZE);

    // Get the current time in milliseconds since the epoch
    long millis = event.getTimeStamp();

    // Append the date and time to the buffer
    sbuf.append(OptionConverter.dateToString(millis, null));

    // Append the thread name to the buffer
    sbuf.append(" [").append(event.getThreadName()).append("] ");

    // Append the logger name to the buffer
    sbuf.append(event.getLoggerName());

    // Append the log level to the buffer
    sbuf.append(" ").append(event.getLevel().toString());

    // Append the message to the buffer
    sbuf.append(": ").append(event.getMessage());

    // Append any throwable information to the buffer
    Throwable throwable = event.getThrowableInformation() != null ? event.getThrowableInformation().getThrowable() : null;
    if (throwable != null) {
        sbuf.append("\n");
        OptionConverter.printStackTrace(throwable, sbuf);
    }

    // Return the formatted string
    return sbuf.toString();
}

