public static void selectRow(int row,JTable table,JScrollPane pane){
    if(row<0||row>=table.getRowCount()){
        return;
    }
    ListSelectionModel selectionModel=table.getSelectionModel();
    selectionModel.setSelectionInterval(row,row);
    int firstVisibleRow=pane.getViewport().getViewPosition().y/table.getRowHeight();
    int lastVisibleRow=firstVisibleRow+pane.getHeight()/table.getRowHeight()-1;
    if(row<firstVisibleRow){
        pane.getVerticalScrollBar().setValue(table.convertRowIndexToView(row)*table.getRowHeight());
    }else if(row>lastVisibleRow){
        pane.getVerticalScrollBar().setValue((table.convertRowIndexToView(row)-lastVisibleRow+1)*table.getRowHeight());
    }
}

